define('text!data/project.json',[],function () { return '{\n  "rokkan": {\n    "real-health": {\n      "url": "/rokkan/real-health",\n      "name": "Real Health",\n      "description": "An informational website about the Affordable Care Act and information about the Exchange portals.",\n      "project": {\n        "title": "Real Health",\n        "lede": {\n          "image": "/img/lede--real-health.jpg",\n          "tldr": "HTML, CSS, JS, Twig, PHP, NodeJS",\n          "example": "http://real-health.com",\n          "quote": "Stories about Real Health"\n        },\n        "summary": {\n          "image": "/img/summary--real-health.jpg",\n          "copy": "Finding information on the ACA is difficult. This website helps by presenting a personal perspective about health insurance. Early on in the project, I helped establish that people would most likely be viewing this site on mobile devices. Since then, the development team and I have handled both performance and layout audits."\n        },\n        "conclusion": "The Patient Protection and Affordable Care Act, ACA for short, was signed in to effect on the 23rd of March 2010. This website, created for Americans needing information on the ACA, offers inspiration on why health care matters to them and suggests health care providers to connect with if they live in one of 14 states."\n      }\n    },\n    "jetblue": {\n      "url": "/rokkan/jetblue",\n      "name": "JetBlue",\n      "description": "JetBlue 2012 / TrueBlue 2013 redesign.",\n      "project": {\n        "title": "JetBlue",\n        "lede": {\n          "image": "/img/lede--jetblue.jpg",\n          "tldr": "HTML, CSS, JS, RequireJS",\n          "example": "http://jetblue.com",\n          "quote": "An updated way to book flights"\n        },\n        "summary": {\n          "image": "/img/summary--jetblue.jpg",\n          "copy": "In 2011, JetBlue made Rokkan Agency of Record (AOR). As the AOR, we had to redesign their main website. Since then, I\'ve worked both as a part of a team and as project lead in the development of the booking engine, TrueBlue redesign, and the recently launched TrueBlue Family Pooling point-sharing program."\n        },\n        "conclusion": "This project had me cut my teeth on a lot of new techniques. Over the course of 1.5 years and 795 commits, I\'ve learn a lot about working with off-shore teams, jQuery UI, Compass project integration, and RequireJS."\n      }\n    }\n  },\n  "talks": {\n    "introducing-grunt": {\n      "url": "/talks/introducing-grunt",\n      "name": "Introducing Grunt",\n      "description": "A grunt workflow primer given internally at Rokkan.",\n      "project": {\n        "title": "Introducing Grunt",\n        "lede": {\n          "image": "/img/lede--introducing-grunt.jpg",\n          "tldr": "HTML, CSS, JS, BespokeJS",\n          "example": "http://rokkan.rogeruiz.com/",\n          "quote": "Change is hard."\n        },\n        "summary": {\n          "image": "/img/summary--introducing-grunt.jpg",\n          "copy": "Getting people excited about a new tools might be harder than it sounds. They can be complicated and interfere with proven processes. This talk concentrated on showing examples of how Grunt was introduced into our workflow and how to install it."\n        },\n        "conclusion": "When it isn\'t easy to convince someone of a new change, no matter how fervent I can get about it, it\'s usually better to show them how to do it themselves and what you\'ve used it for yourself. Having some beta-testers around doesn\'t hurt either."\n      }\n    }\n  }\n}';});

